var moment=require("../../moment");exports.durationFromMoments={setUp:function(a){moment.createFromInputFallback=function(){throw new Error("input not handled by moment")};a()},"pure year diff":function(c){var b=moment("2012-01-01T00:00:00.000Z"),a=moment("2013-01-01T00:00:00.000Z");c.equal(moment.duration({from:b,to:a}).as("years"),1,"year moment difference");c.equal(moment.duration({from:a,to:b}).as("years"),-1,"negative year moment difference");c.done()},"month and day diff":function(e){var b=moment("2012-01-15T00:00:00.000Z"),a=moment("2012-02-17T00:00:00.000Z"),c=moment.duration({from:b,to:a});e.equal(c.get("days"),2);e.equal(c.get("months"),1);e.done()},"day diff, separate months":function(e){var b=moment("2012-01-15T00:00:00.000Z"),a=moment("2012-02-13T00:00:00.000Z"),c=moment.duration({from:b,to:a});e.equal(c.as("days"),29);e.done()},"hour diff":function(e){var b=moment("2012-01-15T17:00:00.000Z"),a=moment("2012-01-16T03:00:00.000Z"),c=moment.duration({from:b,to:a});e.equal(c.as("hours"),10);e.done()},"minute diff":function(e){var b=moment("2012-01-15T17:45:00.000Z"),a=moment("2012-01-16T03:15:00.000Z"),c=moment.duration({from:b,to:a});e.equal(c.as("hours"),9.5);e.done()}};